                    <div class="tab-pane fade" id="potensipariwisata" role="tabpanel" aria-labelledby="profile-tab">
                        <p>Kabupaten Sukabumi, yang terletak di Jawa Barat, memiliki potensi pariwisata yang cukup besar dan
                            berkembang pesat. Secara geografis, wilayah ini dikenal memiliki pesona alam yang luar biasa,
                            mulai dari pantai, perbukitan, hingga kawasan pegunungan yang memikat wisatawan. Kabupaten
                            Sukabumi memiliki banyak tempat wisata yang tersebar di berbagai kecamatan, dengan lebih dari
                            <strong>100 destinasi wisata</strong> yang dapat dikunjungi. Beberapa kawasan wisata terkenal di
                            Sukabumi meliputi:</p>
                        <ol>
                            <li><strong>Pantai dan Pesisir Laut</strong>: Kabupaten Sukabumi memiliki pantai-pantai yang
                                indah, salah satunya adalah <strong>Pantai Pelabuhanratu</strong>, yang terkenal dengan
                                ombaknya yang besar dan keindahan alam sekitarnya. Selain itu, ada juga <strong>Pantai
                                    Cimaja</strong> yang populer di kalangan peselancar, serta pantai-pantai lainnya di
                                sepanjang pesisir selatan.</li>
                            <li><strong>Wisata Alam Pegunungan</strong>: Daerah ini juga dikenal dengan wisata alam
                                pegunungan, seperti di <strong>Taman Nasional Gunung Halimun Salak</strong>, yang menjadi
                                destinasi favorit bagi para pecinta alam dan penggemar aktivitas hiking. Selain itu,
                                terdapat juga <strong>Cikundul</strong> dan <strong>Cibereum</strong>, yang menawarkan
                                pesona alam yang menakjubkan dengan air terjun dan pemandangan yang menyejukkan.</li>
                            <li><strong>Wisata Air Terjun</strong>: Kabupaten Sukabumi memiliki banyak air terjun yang
                                menarik, seperti <strong>Air Terjun Cikaso</strong> yang terkenal dengan tiga tingkat air
                                terjun yang memukau. Air terjun lainnya yang juga populer adalah <strong>Air Terjun Curug
                                    Cikandang</strong> dan <strong>Curug Cimarinjung</strong>.</li>
                            <li><strong>Wisata Budaya dan Sejarah</strong>: Selain wisata alam, Sukabumi juga memiliki
                                potensi wisata budaya, seperti di <strong>Kampung Naga</strong> yang memperkenalkan
                                kehidupan tradisional masyarakat Sunda. Ada juga beberapa situs sejarah yang menarik seperti
                                <strong>Benteng Van Der Wijck</strong> yang terletak di daerah Pabuaran.</li>
                        </ol>
                        <p>Mengenai <strong>jumlah kunjungan wisatawan</strong>, Kabupaten Sukabumi mengalami peningkatan
                            yang signifikan dalam beberapa tahun terakhir, meskipun sempat terdampak oleh pandemi COVID-19.
                            Pada tahun 2022, jumlah kunjungan wisatawan ke Kabupaten Sukabumi diperkirakan mencapai lebih
                            dari <strong>1 juta wisatawan</strong>. Wisatawan yang datang sebagian besar berasal dari
                            wilayah sekitar seperti Jakarta, Bandung, dan kota-kota lainnya di Jawa Barat, namun juga ada
                            peningkatan wisatawan dari luar provinsi. Dengan semakin berkembangnya sektor pariwisata, baik
                            dari segi infrastruktur, akomodasi, maupun promosi wisata, angka kunjungan ini diprediksi akan
                            terus meningkat, terutama dengan munculnya berbagai destinasi baru yang menarik di wilayah ini.
                        </p>
                        <p>Upaya pemerintah daerah untuk meningkatkan kualitas dan kuantitas sektor pariwisata di Sukabumi
                            terlihat melalui pembangunan infrastruktur yang mendukung aksesibilitas ke tempat-tempat wisata,
                            serta program-program yang mengedepankan keberlanjutan dan pelestarian alam. Pariwisata di
                            Kabupaten Sukabumi, dengan pesona alamnya yang luar biasa, diyakini memiliki potensi besar untuk
                            menjadi salah satu destinasi unggulan di Jawa Barat.</p>
                        <p>Namun, berdasarkan tren yang umum, beberapa destinasi wisata utama di Sukabumi yang paling sering
                            dikunjungi oleh wisatawan meliputi:</p>
                        <ol>
                            <li><strong>Pantai Pelabuhanratu</strong>
                                <ul>
                                    <li>Dikenal sebagai salah satu pantai terbaik di Jawa Barat, Pelabuhanratu selalu
                                        menjadi destinasi utama untuk wisata pantai dan aktivitas laut.</li>
                                    <li>Jumlah kunjungan wisatawan biasanya sangat tinggi, terutama pada musim liburan.</li>
                                </ul>
                            </li>
                            <li><strong>Taman Nasional Gunung Halimun Salak</strong>
                                <ul>
                                    <li>Sebagai salah satu taman nasional terbesar di Jawa Barat, Halimun Salak adalah
                                        tujuan favorit bagi para pecinta alam dan pendaki gunung.</li>
                                    <li>Kunjungan wisatawan di sini juga cukup tinggi, terutama di akhir pekan dan liburan.
                                    </li>
                                </ul>
                            </li>
                            <li><strong>Air Terjun Cikaso</strong>
                                <ul>
                                    <li>Air terjun ini sangat populer di kalangan wisatawan yang mencari keindahan alam dan
                                        spot foto menarik.</li>
                                    <li>Kunjungan biasanya meningkat saat musim liburan panjang dan akhir pekan.</li>
                                </ul>
                            </li>
                            <li><strong>Pantai Cimaja</strong>
                                <ul>
                                    <li>Pantai ini terkenal di kalangan peselancar dan wisatawan yang mencari pengalaman
                                        pantai yang lebih tenang.</li>
                                    <li>Wisatawan yang datang ke Cimaja cukup ramai, terutama pada musim surfing dan liburan
                                        sekolah.</li>
                                </ul>
                            </li>
                            <li><strong>Kampung Naga</strong>
                                <ul>
                                    <li>Sebagai wisata budaya, Kampung Naga menarik wisatawan yang tertarik dengan kehidupan
                                        tradisional masyarakat Sunda.</li>
                                    <li>Meskipun kunjungannya cenderung lebih stabil sepanjang tahun, ada peningkatan pada
                                        hari-hari besar atau acara khusus.</li>
                                </ul>
                            </li>
                        </ol>
                    </div>

                    <div class="tab-pane fade" id="potensiperikanan" role="tabpanel" aria-labelledby="contact-tab">
                        <p>Kabupaten Sukabumi memiliki potensi kelautan dan perikanan yang sangat besar, baik dari segi
                            perikanan tangkap, budidaya, maupun pengolahan hasil laut. Berikut adalah beberapa data utama
                            mengenai potensinya:</p>
                        <ol>
                            <li><strong>Produksi Kelautan dan Perikanan</strong></li>
                        </ol>
                        <ul>
                            <li>Perikanan Tangkap
                                <ul>
                                    <li>Luas wilayah pesisir mencapai 10.445,45 hektare, dengan jumlah nelayan aktif
                                        sebanyak 9.811 orang dan alat tangkap sekitar 3.385 unit.</li>
                                    <li>Produksi perikanan tangkap pada 2022 mencapai 7.054 ton, dengan komoditas unggulan
                                        seperti lobster, tuna/cakalang, layur, teri, marlin, lisong, dan sidat</li>
                                    <li>Lobster: Salah satu komoditas utama yang cukup banyak ditemukan di perairan
                                        Kabupaten Sukabumi, khususnya di wilayah pesisir Palabuhanratu.</li>
                                    <li>Tuna / Cakalang: Ikan tuna dan cakalang juga menjadi komoditas penting, dengan
                                        permintaan tinggi untuk pasar lokal maupun ekspor.</li>
                                    <li>Layur: Ikan layur banyak ditangkap oleh nelayan di pesisir Sukabumi, dengan pasar
                                        yang cukup besar.</li>
                                    <li>Teri: Teri merupakan salah satu hasil laut yang banyak dikonsumsi oleh masyarakat
                                        setempat dan memiliki nilai ekonomis.</li>
                                    <li>Marlin: Ikan marlin juga termasuk dalam komoditas unggulan yang dihasilkan di
                                        perairan Sukabumi.</li>
                                    <li>Lisong: Komoditas ikan lisong yang juga cukup umum ditemukan di perairan daerah ini.
                                    </li>
                                    <li>Sidat: Sidat menjadi salah satu produk unggulan yang dipasarkan baik lokal maupun
                                        untuk ekspor.</li>
                                </ul>
                            </li>
                            <li>Budidaya dan Pengembangan Udang
                                <ul>
                                    <li>Kabupaten Sukabumi menjadi daerah percontohan untuk tambak udang berkelanjutan,
                                        terutama di Kecamatan Ciemas. Potensi budidaya ini mendukung program nasional untuk
                                        meningkatkan ekspor udang hingga 250% pada 2024. Sistem tambak berkelanjutan yang
                                        diterapkan mencakup pengelolaan air laut yang bersih dan kaidah budidaya yang baik
                                    </li>
                                    <li>Kabupaten Sukabumi berfokus pada pengembangan tambak udang berkelanjutan, terutama
                                        di Kecamatan Ciemas. Udang memiliki potensi besar karena nilai ekspornya yang
                                        tinggi. Sukabumi diharapkan menjadi daerah percontohan untuk budidaya udang dengan
                                        sistem berkelanjutan.</li>
                                </ul>
                            </li>
                            <li>Budidaya Air Payau dan Air Tawar
                                <ul>
                                    <li>Potensi besar juga ditemukan dalam budidaya air payau dan air tawar, meskipun
                                        pemanfaatannya baru sebagian kecil. Ini membuka peluang besar untuk pengembangan
                                        usaha lebih lanjut.</li>
                                    <li>Ikan Air Payau: Potensi budidaya ikan air payau sangat besar, meskipun saat ini
                                        pemanfaatannya masih terbatas.</li>
                                    <li>Ikan Air Tawar: Selain itu, Kabupaten Sukabumi juga memiliki potensi untuk budidaya
                                        ikan air tawar, yang dapat dimanfaatkan untuk konsumsi lokal maupun pasar yang lebih
                                        luas</li>
                                </ul>
                            </li>
                            <li>Pengolahan dan Pemasaran Hasil Perikanan</li>
                        </ul>
                        <p>Kabupaten ini memiliki 1.681 pelaku usaha yang bergerak dalam pengolahan hasil laut, menghasilkan
                            berbagai jenis produk olahan yang berpotensi untuk pasar lokal dan ekspor.</p>
                        <ul>
                            <li>Pengelolaan Sumber Daya dan Ekonomi Biru</li>
                        </ul>
                        <p>Pemerintah setempat juga fokus pada pengembangan ekonomi biru untuk mendorong keberlanjutan dan
                            kesejahteraan masyarakat pesisir. Pendekatan ini mencakup inkubasi bisnis inovasi kelautan dan
                            perikanan, serta penguatan UKM berbasis sumber daya laut</p>
                        <p>&nbsp;</p>
                        <ol>
                            <li><strong>Kondisi Pelabuhan Perikanan</strong></li>
                        </ol>
                        <p>Di Kabupaten Sukabumi, terdapat beberapa pelabuhan perikanan yang menjadi pusat kegiatan
                            perikanan, baik untuk penangkapan ikan maupun untuk pengolahan hasil laut. Berikut adalah
                            pelabuhan perikanan utama yang ada di Sukabumi beserta kondisinya:</p>
                        <ul>
                            <li>Pelabuhan Perikanan Nusantara (PPN) Palabuhanratu
                                <ul>
                                    <li>Kondisi: Pelabuhan ini merupakan pelabuhan utama di Kabupaten Sukabumi dan memiliki
                                        fasilitas yang lengkap untuk kegiatan perikanan, seperti dermaga untuk kapal ikan,
                                        tempat pelelangan ikan (TPI), dan fasilitas pengolahan ikan. PPN Palabuhanratu juga
                                        menjadi tempat pendaratan hasil perikanan terbesar di wilayah ini.</li>
                                    <li>Kapasitas: Pelabuhan ini melayani kegiatan perikanan tangkap skala besar dan
                                        menengah, serta sejumlah kegiatan ekspor hasil laut, terutama untuk komoditas
                                        seperti lobster dan ikan tuna.</li>
                                    <li>Fasilitas: Dilengkapi dengan fasilitas yang mendukung pengolahan ikan dan pelayanan
                                        perikanan lainnya. Meskipun sudah cukup baik, ada beberapa tantangan terkait
                                        modernisasi fasilitas dan peningkatan efisiensi operasional.</li>
                                </ul>
                            </li>
                            <li>Pelabuhan Perikanan di Cisolok
                                <ul>
                                    <li>Kondisi: Pelabuhan ini juga digunakan untuk kegiatan perikanan lokal di kawasan
                                        selatan Sukabumi, khususnya untuk menangkap ikan jenis layur dan cakalang. Meskipun
                                        lebih kecil dibandingkan dengan Palabuhanratu, pelabuhan ini masih cukup vital untuk
                                        pendaratan ikan.</li>
                                    <li>Fasilitas: Fasilitas di Pelabuhan Cisolok lebih sederhana, tetapi cukup untuk
                                        mendukung kegiatan perikanan lokal. Fasilitas untuk kapal perikanan dan tempat
                                        pelelangan ikan ada, namun masih membutuhkan peningkatan untuk mengakomodasi lebih
                                        banyak kapal.</li>
                                </ul>
                            </li>
                            <li>Pelabuhan Perikanan di Ciemas
                                <ul>
                                    <li>Kondisi: Pelabuhan Ciemas terletak di wilayah yang juga berkembang untuk budidaya
                                        perikanan, khususnya budidaya udang. Kawasan ini diharapkan menjadi pusat
                                        pengembangan tambak udang berkelanjutan, yang mendukung kegiatan ekspor udang.
                                        Pelabuhan ini saat ini masih dalam tahap pengembangan untuk meningkatkan
                                        kapasitasnya.</li>
                                    <li>Fasilitas: Meskipun belum sebesar Palabuhanratu, Pelabuhan Ciemas diharapkan akan
                                        memiliki fasilitas yang mendukung untuk kegiatan ekspor udang dan komoditas
                                        perikanan lainnya. Dengan adanya proyek pengembangan tambak udang berkelanjutan,
                                        pelabuhan ini diharapkan dapat meningkat kapasitasnya untuk mengakomodasi kegiatan
                                        ekspor.</li>
                                </ul>
                            </li>
                        </ul>
                        <p>Secara umum, pelabuhan-pelabuhan perikanan di Kabupaten Sukabumi mendukung aktivitas perikanan
                            yang cukup berkembang, namun masih ada tantangan untuk meningkatkan kapasitas dan fasilitas agar
                            dapat lebih optimal, khususnya untuk mendukung ekspor dan pengolahan produk laut.</p>
                        <p>&nbsp;</p>
                        <ol>
                            <li><strong>Kondisi Armada Kapal Perikanan</strong></li>
                        </ol>
                        <p>Saat ini, di Kabupaten Sukabumi tercatat ada sekitar 3.385 unit kapal perikanan yang beroperasi.
                            Berikut adalah rincian dan kondisi kapal perikanan yang ada di wilayah tersebut:</p>
                        <ul>
                            <li>Jumlah dan Jenis Kapal:
                                <ul>
                                    <li>Kapal Nelayan: Sebagian besar kapal di Kabupaten Sukabumi adalah kapal nelayan skala
                                        kecil hingga menengah yang digunakan untuk menangkap berbagai komoditas perikanan
                                        seperti lobster, tuna, dan ikan lainnya.</li>
                                    <li>Kapal Motor Tempel: Jenis kapal ini banyak digunakan oleh nelayan tradisional yang
                                        lebih mengandalkan alat tangkap sederhana.</li>
                                    <li>Kapal Besar: Meskipun sebagian besar kapal di Sukabumi adalah kapal kecil, ada juga
                                        kapal perikanan menengah yang digunakan untuk operasi lebih jauh di laut, termasuk
                                        penangkapan ikan tuna dan cakalang.</li>
                                </ul>
                            </li>
                            <li>Kondisi Kapal:
                                <ul>
                                    <li>Kapal Nelayan Skala Kecil: Banyak kapal kecil yang beroperasi di wilayah pesisir
                                        Sukabumi, namun banyak dari kapal ini yang berusia tua dan membutuhkan perbaikan.
                                        Fasilitas dan perlengkapan pada kapal ini juga sering kali terbatas, mengingat
                                        keterbatasan dana para nelayan.</li>
                                    <li>Kapal Motor Tempel: Kapal jenis ini umumnya lebih sederhana, dengan beberapa nelayan
                                        masih menggunakan teknologi yang sudah ketinggalan zaman, sehingga mengurangi
                                        efisiensi operasional dan keselamatan.</li>
                                    <li>Kapal Besar: Kapal-kapal ini lebih terawat, terutama yang digunakan oleh nelayan
                                        komersial yang lebih besar. Namun, fasilitas dan fasilitas pendukung di pelabuhan
                                        masih perlu perbaikan untuk menampung kapal-kapal besar dengan lebih optimal.</li>
                                </ul>
                            </li>
                        </ul>
                        <p>Secara keseluruhan, meskipun ada sejumlah kapal yang cukup besar dan modern, sebagian besar kapal
                            perikanan di Kabupaten Sukabumi masih menghadapi tantangan terkait perawatan dan perlengkapan
                            yang memadai. Hal ini berdampak pada efisiensi penangkapan ikan dan keselamatan nelayan.</p>
